import Header from "./components/Header";
import "./App.css";
import Balance from "./components/Balance";
import IncomeExpenses from "./components/IncomeExpenses";

const App = () => {
  return (
    <>
      <Header title={"Expense tracker "} />

      <div className="container">
        <Balance />
        <IncomeExpenses />
      </div>
    </>
  );
};

export default App;
